<pre> <code> servidor {
    Ouça 80;
    server_name localhost;

    Localização / {
        try_files $ uri $ uri/index.php $ uri/index.html $ uri/index.php;
    }

    índice index.php;
}
</code> </pre>

Substitua `<strong> hostName </strong>` pela sua própria instância do servidor PostgreSQL.Você também deve substituir `<strong> porta </strong>` por qualquer porta que deseja usar.

Quanto à segunda opção, você pode usar o seguinte comando para executar consultas SQL diretamente:

<pre> <code> servidor {
    Ouça 80;
    server_name localhost;

    Localização / {
        try_files $ uri $ uri/index.php $ uri/index.html $ uri/index.php;
    }
}
</code> </pre>

