`` `
importar {componente, oninit} de '@angular/core';
importar {ngmodule} de '@angular/core';

@Componente({
  Seletor: 'My-App',
  Modelo: `
    <button (clique) = "OnClick ()"> Clique aqui </botão>
  `
})
Classe de exportação MyComponent {
  @Input () myComponent: elementRef;

  nGoninit () {
    this.myComponent.addeventListener ('click', () => {
      console.log (this.myComponent);
    });
  }
}
`` `

Neste exemplo, estamos obtendo todos os elementos `<a>` dentro dos seus componentes, incluindo o botão de rádio, e chamando o método `OnClick ()` nele.Observe que, neste exemplo, estamos passando por cada elemento `<div>` dentro do seu componente (` myComponent`, `MyComponent`), para que possamos acessar diretamente esses elementos através do objeto` props`.

